import React from "react";
import "./App.css";

function App() {
  return (
    <div className="dashboard">
      <header className="header">Water Chemistry Dashboard</header>
      <div className="container">
        <aside className="filters">Filter Panel</aside>
        <main className="plots">Plots</main>
        <section className="map">Map</section>
      </div>
    </div>
  );
}

export default App;
